library(shiny)
library(DT)
library(htmltools)
library(dplyr)
library(readr)
book3 <- read_csv("data/book3.csv")
# <<< SET THIS to your GO column name >>>
go_col <- "GO_BP_terms_Katarina"   # e.g., "GO_terms" with terms separated by "; "

css <- "
table.dataTable tbody td{
  max-width:180px;               /* fixed-ish column width */
  white-space:nowrap;            /* keep row height fixed */
  overflow:hidden;               /* clip overflow */
  text-overflow:ellipsis;        /* â€¦ for overflowed text */
  line-height:20px; height:20px; /* fixed row height */
}
.go-term { padding:0 2px; }
.go-term.match { background:#ffef9f; border-radius:3px; }
"

ui <- fluidPage(
  tags$head(tags$style(HTML(css))),

  # JS handlers: select/deselect only FILTERED rows and sync to Shiny
  tags$script(HTML("
    Shiny.addCustomMessageHandler('dt-select-all', function(id){
      var el = $('#'+id+' table');
      if (!el.length) return;
      var tbl = el.DataTable();
      var rows = tbl.rows({search: 'applied'});   // only filtered rows
      rows.select();
      // push 1-based display indices so R sees them
      var idx = rows.indexes().toArray().map(function(i){ return i + 1; });
      Shiny.setInputValue(id + '_rows_selected', idx, {priority: 'event'});
    });
    Shiny.addCustomMessageHandler('dt-deselect-all', function(id){
      var el = $('#'+id+' table');
      if (!el.length) return;
      var tbl = el.DataTable();
      tbl.rows({search: 'applied'}).deselect();
      Shiny.setInputValue(id + '_rows_selected', [], {priority: 'event'});
    });
  ")),

  fluidRow(
    column(8,
           textInput("goq", "Filter rows by GO term (contains):", placeholder = "axon"),
           actionButton('select_all', 'Select all (filtered)'),
           actionButton('clear_sel', 'Clear selection (filtered)')
    ),
    column(4, align = "right",
           checkboxInput("export_matches_only",
                         "Export only matching GO terms", value = TRUE),
           downloadButton('download_csv', 'Export selected as CSV')
    )
  ),
  br(),
  DTOutput("tbl", height = "400px")
)

server <- function(input, output, session){

  # helpers
  split_terms <- function(x) {
    if (is.na(x) || !nzchar(x)) return(character(0))
    strsplit(x, ";\\s*")[[1]]
  }

  # Build the view shown in DT: filter rows by GO term query,
  # add a highlighted display column and a matched-only column for export
  df_view <- reactive({
    validate(need(go_col %in% names(book3),
                  sprintf("Column '%s' not found in data.", go_col)))
    d <- book3

    q <- input$goq
    if (is.null(q)) q <- ""
    q <- trimws(q)

    # row filter: keep rows whose GO column contains the query
    if (nzchar(q)) {
      keep <- grepl(q, d[[go_col]], ignore.case = TRUE)
      d <- d[keep, , drop = FALSE]
    }

    # Matched-only terms for export
    d$Matched_GO_terms <- vapply(d[[go_col]], function(cell) {
      terms <- split_terms(cell)
      if (!nzchar(q)) return("")
      paste(terms[grepl(q, terms, ignore.case = TRUE)], collapse = "; ")
    }, character(1))

    # HTML display with matches highlighted
    d$GO_terms_display <- vapply(d[[go_col]], function(cell) {
      terms <- split_terms(cell)
      if (!length(terms)) return("")
      paste(vapply(terms, function(t) {
        if (nzchar(q) && grepl(q, t, ignore.case = TRUE)) {
          paste0("<span class='go-term match'>", htmlEscape(t), "</span>")
        } else {
          paste0("<span class='go-term'>", htmlEscape(t), "</span>")
        }
      }, character(1)), collapse = "; ")
    }, character(1))

    d
  })

  output$tbl <- renderDT({
    d <- df_view()

    # Show all original columns but replace the GO column with the highlighted display
    show_cols <- names(d)
    # move GO_terms_display to the position of go_col
    show_cols[match(go_col, show_cols)] <- "GO_terms_display"

    # headers: keep original column name
    headers <- show_cols
    headers[headers == "GO_terms_display"] <- go_col

    # escape everything except the display column (so HTML renders)
    esc_idx <- setdiff(seq_along(show_cols), match("GO_terms_display", show_cols))

    datatable(
      d[, show_cols, drop = FALSE],
      filter    = "top",
      rownames  = FALSE,
      selection = list(mode = "multiple"),
      extensions = c("Select"),
      options = list(
        scrollY = 400,
        scrollX = TRUE,
        paging  = FALSE,
        select  = list(style = "multi"),
        columnDefs = list(list(width = "180px", targets = "_all"))
      ),
      colnames = headers,
      escape   = esc_idx
    )
  }, server = FALSE)

  # Buttons: act on FILTERED rows only
  observeEvent(input$select_all, {
    session$sendCustomMessage("dt-select-all", "tbl")
  })
  observeEvent(input$clear_sel, {
    session$sendCustomMessage("dt-deselect-all", "tbl")
  })

  # Export selected rows (from the filtered view), optionally only matched GO terms
  output$download_csv <- downloadHandler(
    filename = function() paste0("selected_rows_", format(Sys.time(), "%Y%m%d-%H%M%S"), ".csv"),
    content = function(file) {
      d   <- df_view()                    # current filtered view with helper cols
      sel <- input$tbl_rows_selected
      if (!length(sel)) {
        write.csv(d[0, , drop = FALSE], file, row.names = FALSE)
        return()
      }
      out <- d[sel, , drop = FALSE]

      if (isTRUE(input$export_matches_only)) {
        out[[go_col]] <- out$Matched_GO_terms
      }

      # drop helper columns from export
      drop_cols <- c("GO_terms_display", "Matched_GO_terms")
      out <- out[, setdiff(names(out), drop_cols), drop = FALSE]

      write.csv(out, file, row.names = FALSE)
    }
  )
}

shinyApp(ui, server)
